  false,\n\t\"url\": null,\n\t\"notes\": \"A statistically significant loss of plant
  cover occurred at most disturbed plots, but few plots showed recovery. In riparian
  shrubland, cover values for horsetails showed recovery, but other species and life
  forms still had decreased cover compared to their controls. One highly disturbed
  Dryas terrace plot showed significant gains in cover of Dryas integrifolia, deciduous
  shrubs, and forbs, but still had the greatest cover loss of any study plot. The
  data collected in this study will be used as a basis for measuring the long-term
  effects of seismic trails and ice roads on the arctic coastal plain.\",\n\t\"owner_org\":
